        const formatInlineEmbeddedImg = (html: string): { updatedHtml: string, attachments: any[] } => {
            /**
             * Regular expression to match <img> tags
             * The following regex is used to match an HTML <img> element that has a src attribute with a value in the form of a base64-based data URI. This data URI is usually used to store image data directly in HTML without the need to include a separate file.
             */
            const imgTagRegex = /<img\s+src=["'](data:image\/([^;]+);base64,([^"']*))["'].*?>/g;

            let matches: RegExpExecArray | null;
            let updatedHtml = html;
            let attachments: any[] = [];

            // Find all <img> tags with base64 encoded content in the input HTML
            while ((matches = imgTagRegex.exec(html)) !== null) {
                const imgTag = matches[0];  // The entire <img> tag

                // Create an Attachment object based on the <img>
                const attachmentName = `image_${Math.random().toString(36).substring(7)}.jpg`;  // Provide a suitable name
                const attachmentContentType = matches[2];  // The content type
                const attachmentContent = matches[3];  // The base64 encoded content
                const attachmentContentId = `attachment_${Math.random().toString(36).substring(7)}`;  // Generate a random ContentId

                const attachment = {
                    Name: attachmentName,
                    ContentID: attachmentContentId,
                    Content: attachmentContent,
                    ContentType: attachmentContentType,
                };
                attachments.push(attachment);

                // Update the <img> tag's src attribute to use the ContentId of the Attachment
                const updatedImgTag = `<img src="${attachment.ContentID}">`

                // Replace the original <img> tag with the updated one in the HTML
                updatedHtml = updatedHtml.replace(imgTag, updatedImgTag);
            }

            return {
                updatedHtml: updatedHtml,
                attachments: attachments
            };
        }


